import Link from 'next/link';

const Index = () => {
  return (
    <div className="">
      <p>hello next.js</p>
      <ul className="nav">
        <li>
          <Link href="/about" title="About Page">
            about
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default Index;
